# y_val = y_val.astype('uint8') # Keep as uint8 for masks

# print("Data type of X_train_split:", X_train_split.dtype)
# print("Data type of y_train_split:", y_train_split.dtype)
# print("Data type of X_val:", X_val.dtype)
# print("Data type of y_val:", y_val.dtype)

# print("Shape of X_train_split:", X_train_split.shape)
# print("Shape of y_train_split:", y_train_split.shape)
# print("Shape of X_val:", X_val.shape)
# print("Shape of y_val:", y_val.shape)

################################
#Modelcheckpoint
checkpointer = tf.keras.callbacks.ModelCheckpoint('model.h5', verbose=1, save_best_only=True)

callbacks = [
        tf.keras.callbacks.EarlyStopping(patience=3, monitor='val_loss'),
        tf.keras.callbacks.TensorBoard(log_dir='logs')]

results = model.fit(
    x_train,
    y_train,
    validation_split=0.1,
    batch_size=16,
    epochs=50,
    callbacks=callbacks)

    # X_train_split,
    # y_train_split
    # validation_split=0.1,
    # batch_size=16,
    # epochs=5,
    # callbacks=callbacks)

# plot model loss over training and validation data
plt.plot(results.history['loss'])
plt.plot(results.history['val_loss'])
plt.title('Model Loss')
plt.ylabel('Loss')
plt.xlabel('Epoch')
plt.legend(['Train', 'Test'], loc='upper left')
plt.show()

idx = random.randint(0, len(x_train))


preds_train = model.predict(x_train[:int(x_train.shape[0]*0.9)], verbose=1)
preds_val = model.predict(x_train[int(x_train.shape[0]*0.9):], verbose=1)
preds_test = model.predict(X_test, verbose=1)


preds_train_t = (preds_train > 0.0).astype(np.uint8)
preds_val_t = (preds_val > 0.0).astype(np.uint8)
preds_test_t = (preds_test > 0.0).astype(np.uint8)

