original_raster_path = '/content/drive/MyDrive/GEE_Exports/testTiles.tif' # Placeholder path

try:
    # Open the original raster file
    with rasterio.open(original_raster_path) as src:
        # Extract the coordinate reference system (CRS)
        original_crs = src.crs
        # Extract the affine transform
        original_transform = src.transform

    print(f"Original CRS: {original_crs}")
    print(f"Original Transform: {original_transform}")

except rasterio.errors.RasterioIOError as e:
    print(f"Error opening original raster file: {e}")
    print("Please provide the correct path to the original raster file.")
    original_crs = None
    original_transform = None

print("Data type of preds_test_t:", preds_test_t.dtype)
print("Shape of preds_test_t:", preds_test_t.shape)

# Ensure the data type is uint8
if preds_test_t.dtype != np.uint8:
    preds_test_t = preds_test_t.astype(np.uint8)
    print("Data type of preds_test_t after conversion:", preds_test_t.dtype)

# The shape is (number_of_masks, height, width, 1).
# For writing to a raster file, we typically need (height, width) or (height, width, bands).
# We will iterate through the masks for writing, so the current shape is acceptable for processing.

import os
import rasterio

output_dir = '/content/drive/MyDrive/GEE_Exports/predicted_masks'
os.makedirs(output_dir, exist_ok=True)

for i, mask in tqdm(enumerate(preds_test_t), total=len(preds_test_t), desc="Writing predicted masks"):
    output_path = os.path.join(output_dir, f'prediction_mask_{i}.tif')

    # Define the profile for the output GeoTIFF
    profile = {
        'driver': 'GTiff',
        'dtype': mask.dtype,
        'count': 1,  # Single band for the mask
        'height': mask.shape[0],
        'width': mask.shape[1],
        'nodata': None, # Assuming no nodata value
        'crs': original_crs if 'original_crs' in locals() and original_crs is not None else None,
        'transform': original_transform if 'original_transform' in locals() and original_transform is not None else None,
        'compress': 'lzw' # Add compression
    }

    # Open and write the raster file
    with rasterio.open(output_path, 'w', **profile) as dst:
        # Rasterio expects (bands, height, width)
        dst.write(mask.squeeze(), 1)

    # Print a confirmation message
    # print(f"Written: {output_path}")

print(f"Finished writing {len(preds_test_t)} predicted masks to {output_dir}")

